function describe(obj) {
    var str;
    if (obj && obj.name) {
        if(typeof obj.name.valueOf() == 'string')
            str = obj.name;
        else if(typeof obj.name == 'function' && obj.name.length == 0) {
            try {    
                str = obj.name();
            } catch(e) {}
        }
    }
    if (!str) str = Objects.shortPrintStringOf(obj);
    if (str.length > 32) str = str.substring(0, 32) + '...';
    return ":  " + str;
}

